    18,nt"tags": [],nt"title": "Partial pressure (or fugacity) of carbon dioxide,
    salinity and other variables collected from time series observations using Bubble
    type equilibrator for autonomous carbon dioxide (CO2) measurement, Carbon dioxide
    (CO2) gas analyzer and other instruments from MOORINGS in the North Pacific Ocean
    from 2010-01-17 to 2013-03-18 (NODC Accession 0084099)",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-29T04:00:41.529251",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-timefacf1",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0084099 includes time series
    data collected from MOORINGS in the North Pacific Ocean from 2010-01-17 to 2013-03-18
    and retrieved during cruise CCE220100117, CCE220110306 and CCE220120324. These data
    include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN
    - PERCENT SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere,
    Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE
    TEMPERATURE. The instruments used to collect these data include Bubble type equilibrator
    for autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
    data were collected by Adrienne Sutton, Christopher Sabine, Stacy Maenner and Sylvia
    Musielewicz of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part
    of the Mooring CCE2_121W_34N_Jan2010_Mar2011, Mooring_CCE2_121W_34N_Mar2011_Dec2011
    and Mooring_CCE2_121W_34N_Mar2012_Mar2013 data set.nnThe Global CO2 Time-series
    and Moorings Project involves international groups from 18 countries who have mounted
    sensors on moored buoys to provide high resolution time-series measurements of atmospheric
    boundary layer and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series
    and Moorings Project is coordinated by UNESCO International Ocean Carbon Coordination
